import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import StartConference from "./StartConference";
import Conference from "./Conference";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<StartConference />} />
          <Route path="/ccasdasdasdasdasdadasdadadsad" element={<Conference />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
